import React, { Component } from "react";
import data from './data/medicines.json';
import 'bootstrap/dist/css/bootstrap.min.css';
//import './medicine.css';
export default class Medicine extends Component {
    render() {
        const match = this.props.match;
        let id = match.params.id;
        const newdata = data.filter(item => item.id === id);
        let medObj;
        if (newdata && newdata.length === 1) {
            medObj = newdata[0];
        }
        if (!medObj) {
            this.props.history.push('/')
        }
        return (<div className="container"><div className="row"><h2 className="">{medObj.name}</h2><div className=""><img className="" src={medObj.image} alt={medObj.name} /></div>
            <div className="">
                <p className="">{medObj.description}&nbsp;</p></div>
        </div></div >)
    }
}
